import React, {useState, useEffect} from "react";
import axios from "axios";

export default function Leaderboard() {
	const [level1, setLevel1] = useState([]);
	const [level2, setLevel2] = useState([]);
	const [level3, setLevel3] = useState([]);

	useEffect(() => {
		axios
			.get("/API/level1-score")
			.then(res => setLevel1(res.data))
			.catch(err => console.log(err));

		axios
			.get("/API/level2-score")
			.then(res => setLevel2(res.data))
			.catch(err => console.log(err));

		axios
			.get("/API/level3-score")
			.then(res => setLevel3(res.data))
			.catch(err => console.log(err));
	}, []);

	const newLevel1 = level1.map(item => (
		<tr>
			<td>{item.name}</td>
			<td>{item.time}</td>
		</tr>
	));
	const newLevel2 = level2.map(item => (
		<tr>
			<td>{item.name}</td>
			<td>{item.time}</td>
		</tr>
	));

	const newLevel3 = level3.map(item => (
		<tr>
			<td>{item.name}</td>
			<td>{item.time}</td>
		</tr>
	));

	console.log(level1, level2, level3);
	return (
		<>
			<div className="table-1">
				<table>
					<thead>
						<td>Name</td>
						<td>Time</td>
					</thead>
					<tbody>{newLevel1}</tbody>
				</table>
			</div>
			<div className="table-2">
				<table>
					<thead>
						<td>Name</td>
						<td>Time</td>
					</thead>
					<tbody>{newLevel2}</tbody>
				</table>
			</div>
			<div className="table-3">
				<thead>
					<td>Name</td>
					<td>Time</td>
				</thead>
				<tbody>{newLevel3}</tbody>
			</div>
		</>
	);
}
